14 días atrás, sábado, jugando la semifinal te caíste de la nada y el corazón de mucha gente y el mío se pararon de repente… “no puede ser” dije a mí mismo, otro infortunio…no! Ahora no, estabas jugando tu mejor padel desde tres años y encontrando con Sanyo la justa química de juego.
En ese mismo momento yo conocía muy bien tu profundo dolor y luego de solo algunas horas, a las nueves exactamente, te escribí, seguro de lo que te estaba diciendo: “Ferna, llega acá, estoy seguro que podemos cortar el tiempo de tu recuperación cualquier pueda ser“ 
“El lunes hago la eco y dependiendo de lo que me dirán el miércoles agarro un vuelo y llegaré!” Dijiste. 
Mi respuesta fue: “No! el lunes después del eco te envío mi avión y te espero en mi casa, no tenemos tiempo que perder”
Desde cuando llegaste no paramos un segundo el trabajo, mucha disciplina, mucha confianza, mucha tecnología innovativa y muchas ganas de demostrar que todo se puede alcanzar con el corazón y con la determinación de ganar otra batalla contra el oponente quitandole y cortándole el tiempo… como en cada punto de padel… tiempo y espacio…
Llegaste en  muletas a L’Eremita, lugar de paz y serenidad y te pusiste en mis manos consciente que tu lesión me dolía como o más que a ti mismo. 
Ahora te vas corriendo y peloteando después de 13 días.
Te Agradezco por  confiar en mí y agradezco también el doctor Jose Manuel Sanchez por confiar en mi y por su tecnica EPI. Agradezco también a “El Profe” Toni Martinez a Juan Erquicia y a Giulia Tarozzi porque un trabajo funciona en equipo, juntos somos mas fuertes y lo demostramos. 
Ahora me voy a poner en la grada como siempre para mirar tus proximos exitos. 
Fuerza Ferna la historia te espera para escribir otras páginas. 
